    [],nt"revision_timestamp": "2015-11-25T17:35:39.803419",nt"name": "gpm-gcom-w1-gmiamsr2-level-3-daily-gprof-profiling-v03",nt"isopen":
    true,nt"url": null,nt"notes": "3GPROF products provide global gridded monthly/daily
    precipitation averages from multiple satellites that can be used for climate studies.
    The 3GPROF products are based on retrievals from high-quality microwave sensors,
    which are sensitive to liquid and ice-phase precipitation hydrometeors in the atmosphere.
    This products currently has the following minor versions: 03B, 03C that are archived
    under one major version. Only the latest available version is available for access
    for a date.The purpose of the 3GPROF algorithm is to provide monthly and daily mean
    precipitation and related retrieved parameters from the Level 2 GPROF precipitation
    profiling algorithm for the GPM core and constellation satellites. Each 3GPROF product
    contains global 0.25 degree x 0.25 degree gridded monthly/daily means. Because this
    product is an accumulation of the Level 2 retrieval products, much more information
    is available via the GPROF Level 2 documentation.",nt"license_title": "U.S.
